    "Help adapter username 1v0": {                    "en": "The username of the created FRITZBox user has to be inserted here", "de": "Hier muss der Benutzername des erstellten FRITZBox-Benutzers eingefügt werden", "ru": "Здесь необходимо указать имя созданного пользователя FRITZBox.", "pt": "O nome de usuário do usuário FRITZBox criado deve ser inserido aqui", "nl": "Hier moet de gebruikersnaam van de aangemaakte FRITZBox-gebruiker worden ingevoerd", "fr": "Le nom d'utilisateur de l'utilisateur FRITZBox créé doit être inséré ici", "it": "Il nome utente dell'utente FRITZBox creato deve essere inserito qui", "es": "El nombre de usuario del usuario de FRITZBox creado debe insertarse aquí", "pl": "W tym miejscu należy wpisać nazwę użytkownika utworzonego użytkownika FRITZBox", "uk": "Тут потрібно вставити ім’я створеного користувача FRITZBox", "zh-cn": "必须在此处插入创建的FRITZBox用户的用户名。"},
