    "Please check the checkbox if you want to create objects for FB-Devices": {"en": "Please check the checkbox if you want to create objects for FB-Devices", "de": "Bitte aktivieren Sie das Kontrollkästchen, wenn Sie Objekte für FB-Geräte erstellen möchten", "ru": "Поставьте галочку, если хотите создавать объекты для FB-устройств.", "pt": "Marque a caixa de seleção se desejar criar objetos para dispositivos FB", "nl": "Vink het selectievakje aan als u objecten voor FB-apparaten wilt maken", "fr": "Veuillez cocher la case si vous souhaitez créer des objets pour les appareils FB", "it": "Selezionare la casella di controllo se si desidera creare oggetti per dispositivi FB", "es": "Marque la casilla de verificación si desea crear objetos para dispositivos FB", "pl": "Zaznacz pole wyboru, jeśli chcesz tworzyć obiekty dla urządzeń FB", "uk": "Будь ласка, поставте прапорець, якщо ви хочете створити об’єкти для FB-пристроїв", "zh-cn": "如果要为FB设备创建对象，请选中该复选框"},
