    "Please check the checkbox if you want to resynchronize the FB-Device objects": {"en": "Please check the checkbox if you want to resynchronize the FB-Device objects", "de": "Bitte aktivieren Sie das Kontrollkästchen, wenn Sie die FB-Device-Objekte neu synchronisieren möchten", "ru": "Пожалуйста, установите флажок, если вы хотите повторно синхронизировать объекты FB-Device", "pt": "Marque a caixa de seleção se desejar ressincronizar os objetos do dispositivo FB", "nl": "Vink het selectievakje aan als u de FB-Device-objecten opnieuw wilt synchroniseren", "fr": "Veuillez cocher la case si vous souhaitez resynchroniser les objets du périphérique FB", "it": "Seleziona la casella di controllo se desideri risincronizzare gli oggetti FB-Device", "es": "Marque la casilla de verificación si desea volver a sincronizar los objetos del dispositivo FB", "pl": "Zaznacz pole wyboru, jeśli chcesz ponownie zsynchronizować obiekty FB-Device", "uk": "Поставте прапорець, якщо ви хочете повторно синхронізувати об’єкти FB-Device", "zh-cn": "如果要重新同步FB设备对象，请选中该复选框"},
